import styled from '@emotion/styled';
import React from 'react'

function Contact() {
    return (
        <Container>
            <Item>
                <ContactDescription>Email: </ContactDescription>
                <ContactValue>ayishetuseidu13@gmail.com</ContactValue>
            </Item>
            <Item>
                <ContactDescription>Phone: </ContactDescription>
                <ContactValue>+233 507157798</ContactValue>
            </Item>
        </Container>
    )
}

export default Contact;

const Container = styled.div`
grid-area: content;
height: 100%;
width: 100%;
background-color: white;
justify-content: centre;
`;
const Item = styled.div`
display: flex;
flex-direction: row;
`;

const ContactDescription = styled.span``;

